    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE NOT + col1 + - + ( + - col1 ) * - col1 * + 80 >= + col1;
  - name: tab0

outputs:
  - name: q5216.out
    data: |
      15	81	47
      87	21	10
      97	1	99
